import React from 'react';

const Group37 = () => {
  return (
    <img
      src="/group37.png" // Place your image in the public folder or update the path accordingly
      alt="Group 37"
      style={{ width: '475.73px', height: '317.85px', objectFit: 'cover', borderRadius: '8px' }}
    />
  );
};

export default Group37;
